import{_ as a,c as n,a2 as t,o}from"./chunks/framework.DDqBDuc9.js";const h=JSON.parse('{"title":"innosetup 制作的安装包 密码破解思路","description":"","frontmatter":{},"headers":[],"relativePath":"posts/Windows/innosetup.md","filePath":"posts/Windows/innosetup.md"}'),i={name:"posts/Windows/innosetup.md"};function p(s,e,r,l,d,c){return o(),n("div",null,e[0]||(e[0]=[t('<h1 id="innosetup-制作的安装包-密码破解思路" tabindex="-1">innosetup 制作的安装包 密码破解思路 <a class="header-anchor" href="#innosetup-制作的安装包-密码破解思路" aria-label="Permalink to &quot;innosetup 制作的安装包 密码破解思路&quot;">​</a></h1><h2 id="如果是这种的exe可以按以下步骤破解密码" tabindex="-1">如果是这种的exe可以按以下步骤破解密码 <a class="header-anchor" href="#如果是这种的exe可以按以下步骤破解密码" aria-label="Permalink to &quot;如果是这种的exe可以按以下步骤破解密码&quot;">​</a></h2><ul><li>exeinfo 展示信息为此信息的是innosetup 制作的安装包</li></ul><p><img src="https://s1.imagehub.cc/images/2023/01/12/61332a7ba958f2e9518e7bf7d6dcc4ad.png" alt="61332a7ba958f2e9518e7bf7d6dcc4ad.png"></p><ul><li>输入密码如图所示:</li></ul><p><img src="https://s1.imagehub.cc/images/2023/01/12/c41eff996e5e7d64e5ca25967eb61ed5.png" alt="c41eff996e5e7d64e5ca25967eb61ed5.png"></p><ul><li>下载 InnoExtractor, 打开想要破解的exe</li></ul><p>注意如果文件过多,会加载很长时间.耐心等待即可, 加载完成后源码文件如下图:</p><p><img src="https://s1.imagehub.cc/images/2023/01/12/373852fa84541fe822b0e7e873644e58.png" alt="373852fa84541fe822b0e7e873644e58.png"></p><ul><li>把如图所示的CompiledCode.bin解压出来, 里面就是innosetip的二进制代码. 直接打开 CompiledCode.bin 看密码即可:</li></ul><p><img src="https://s1.imagehub.cc/images/2023/01/12/e648ed0f15746bef740e89a15066fdf8.png" alt="e648ed0f15746bef740e89a15066fdf8.png"></p><h2 id="破解过程解析及源码" tabindex="-1">破解过程解析及源码 <a class="header-anchor" href="#破解过程解析及源码" aria-label="Permalink to &quot;破解过程解析及源码&quot;">​</a></h2><h3 id="示例exe" tabindex="-1">示例exe <a class="header-anchor" href="#示例exe" aria-label="Permalink to &quot;示例exe&quot;">​</a></h3><p>下载了一个很大的游戏,但是发现安装的时候居然有密码, 而且原论坛提供的密码不对</p><p>原贴</p><p><a href="https://www.52pojie.cn/thread-1729506-1-1.html" target="_blank" rel="noreferrer">https://www.52pojie.cn/thread-1729506-1-1.html</a></p><p>把其中的密码程序提取出来PH17.exe:</p><p><a href="https://wwtw.lanzoum.com/itwIj0ktqzfg" target="_blank" rel="noreferrer">https://wwtw.lanzoum.com/itwIj0ktqzfg</a></p><h3 id="od尝试" tabindex="-1">od尝试 <a class="header-anchor" href="#od尝试" aria-label="Permalink to &quot;od尝试&quot;">​</a></h3><p>本来以为很简单的OD就好了, 发现OD不行.</p><ul><li><p>字符串没法找到定位</p></li><li><p>vb/delphi 按钮查找脚本 找不到按钮事件</p></li></ul><h3 id="innounp" tabindex="-1">innounp <a class="header-anchor" href="#innounp" aria-label="Permalink to &quot;innounp&quot;">​</a></h3><p>最后在<a href="https://stackoverflow.com/questions/49194957/disassembling-strings-from-inno-setup-code/49195240#49195240" target="_blank" rel="noreferrer">stackoverflow.</a>, 看到了<a href="./[stackoverflow.](https://stackoverflow.com/questions/49194957/disassembling-strings-from-inno-setup-code/49195240.html#49195240)">解决办法</a>: 使用 innounp</p><p><a href="https://innounp.sourceforge.net/" target="_blank" rel="noreferrer">innounp官网</a></p><p><a href="https://sourceforge.net/projects/innounp/files/innounp/innounp%200.50/innounp050src.rar/download" target="_blank" rel="noreferrer">innounp源码</a></p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>innounp -x -m PH18.exe</span></span></code></pre></div><p>innounp他是可以代替exe直接解压的</p><p>但是如果打包文件过多,因为它不会跳过解压普通文件, 如果文件过大的话,只能必须等他全部解压完.才可以得到CompiledCode.bin, 才可以知道密码.</p><p>修改innounp源码 <code>innounp.dpr lin475 </code>前加入</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>AddEmbeddedFiles</span></span></code></pre></div><p>就可以先解压CompiledCode.bin</p>',31)]))}const f=a(i,[["render",p]]);export{h as __pageData,f as default};
